    true,nt"url": null,nt"notes": "&lt;p&gt;&amp;nbsp;Specific objectives are:&lt;/p&gt;&lt;ol&gt;&lt;li&gt;Develop
    the fabrication process for producing fuzzy fiber with desired&amp;nbsp;carbon nanotube
    (CNT) length leveraging current collaboration with MIT through the National Space
    Technology Fellowship (NSTRF).&lt;/li&gt;&lt;li&gt;Evaluate fuzzy fiber composites
    with tailored CNT length&lt;/li&gt;&lt;li&gt;Develop&amp;nbsp;Boron Nitride Nanotube
    (BNNT) capabilities to enable incorporation of vertically aligned BNNTs into composite
    structures for multifunctional composite structures.&lt;/li&gt;&lt;li&gt;Model nanotube
    length and loading requirements to maximize transport properties through the resin
    rich inter-ply region of a composite and verify the model from composite data with
    different CNT lengths.&lt;/li&gt;&lt;/ol&gt;",nt"license_title": "U.S. Government
